DROP TABLE IF EXISTS `advert`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `advert` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '广告类型，1:启动图广告，2:视频广告,3:弹窗霸屏广告,4:图文广告',
  `provider_name` varchar(255) NOT NULL DEFAULT '' COMMENT '推广商名称',
  `title` varchar(255) NOT NULL DEFAULT '' COMMENT '广告标题',
  `img_url` varchar(255) NOT NULL DEFAULT '' COMMENT '广告图片',
  `video_url` varchar(255) NOT NULL DEFAULT '' COMMENT '广告视频播放地址',
  `ad_url` varchar(255) NOT NULL DEFAULT '' COMMENT '广告跳转/下载链接',
  `desc` varchar(255) NOT NULL DEFAULT '' COMMENT '广告描述',
  `open_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '打开方式：1：直接下载，2：浏览器打开',
  `end_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '到期时间',
  `view_num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '浏览次数，可做显示那条广告的依据',
  `sort` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '排序',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '广告状态 0 禁用， 1 启用',
  `updated_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `created_at` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`,`type`) USING BTREE,
  KEY `type` (`type`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='广告表';
