  `wx_openid` varchar(255) NOT NULL DEFAULT '' COMMENT '微信openid',
  `qq_openid` varchar(255) NOT NULL DEFAULT '' COMMENT 'QQopenid',
  `wb_openid` varchar(255) NOT NULL DEFAULT '' COMMENT '微博openid',
  `is_admin` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否管理员',
  `is_super` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否超级管理员0:否,1:是',
  `last_login_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后登录时间',
  `tags` varchar(255) NOT NULL DEFAULT '' COMMENT '标签',
